    Kaede
   </b>

   <a href="International District.html" key="f7072861-891b-4f55-8733-1e281a5aeb0b" title="International District">

   Rickshaw
   . It is also where the
   Sisters of Fate
   gang reside, who are led by
   Clotho
   .
